import React from 'react'
import Logo from '../components/Logo'
import './Nav.css'

const Nav = ({onSignOutClick}) => {
    return (
        <div className='nav'>
            <Logo />
            <p 
                className='button'
                onClick={onSignOutClick}
            >
            Sign Out
            </p>
        </div>
    )
}

export default Nav;
